import React from 'react';
import {
  Container,
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
} from 'carbon-components-react';

const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};


const PzSidenav = () => {
  return (
  <div>

    <Container
      render={({ isSideNavExpanded, onClickSideNavExpand }) => (
        <SideNav aria-label="Side navigation" isRail>
        {/*SkipToContent is for web based screen readers    */}
        <SkipToContent />
          <SideNavItems className="black">
            <SideNavLink>Home</SideNavLink>
            <SideNavLink>User Dashboard</SideNavLink>
            <SideNavLink>Now you see it</SideNavLink>
            <SideNavLink>Now you dont</SideNavLink>

            <SideNavMenu>
              <SideNavMenuItem href="#">Item</SideNavMenuItem>
            </SideNavMenu>

            <SideNavMenu>
              <SideNavMenuItem href="#">Item</SideNavMenuItem>
            </SideNavMenu>

            <SideNavMenu>
              <SideNavMenuItem href="#">Item</SideNavMenuItem>
              <SideNavMenuItem href="#">Item</SideNavMenuItem>
            </SideNavMenu>
          </SideNavItems>
        </SideNav>
      )}
    />

  </div>
  );
};

    


export default PzSidenav;
